import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {
  Container,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
  Typography,
  IconButton,
} from '@material-ui/core';
import {
  AccessTime as AccessTimeIcon,
  Star as StarIcon,
  Comment as CommentIcon,
} from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  container: {
    height: '100vh',
    backgroundColor: '#eee',
  },
  card: {
    borderRadius: '15px',
    backgroundColor: '#93e2bb',
  },
  cardContent: {
    padding: theme.spacing(4),
    color: 'black',
  },
  image: {
    width: '70px',
    borderRadius: '50%',
    border: '3px solid black',
  },
  username: {
    marginBottom: theme.spacing(2),
    display: 'flex',
    alignItems: 'center',
  },
  rating: {
    color: '#1B7B2C',
    display: 'flex',
    listStyle: 'none',
    margin: 0,
    padding: 0,
    '& > li': {
      marginRight: theme.spacing(1),
    },
  },
  commentCount: {
    marginBottom: theme.spacing(1),
  },
  bookNowButton: {
    borderRadius: '15px',
    marginTop: theme.spacing(3),
  },
}));

export default function ECommerce() {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <Container>
        <Grid container justifyContent="center">
          <Grid item md={9} lg={7} xl={5} className="mt-5">
            <Card className={classes.card}>
              <CardContent className={classes.cardContent}>
                <div>
                  <Typography variant="h6">Exquisite hand henna tattoo</Typography>
                  <div className={classes.username}>
                    <Typography variant="body2" className="me-2">@sheisme</Typography>
                    <ul className={classes.rating}>
                      {[...Array(5)].map((_, index) => (
                        <li key={index}>
                          <StarIcon fontSize="small" />
                        </li>
                      ))}
                    </ul>
                  </div>
                  <div>
                    <Button variant="outlined" color="dark" size="small">
                      + Follow
                    </Button>
                    <Button variant="outlined" color="dark" size="small" className="mx-1">
                      See profile
                    </Button>
                    <IconButton color="dark" size="small">
                      <CommentIcon />
                    </IconButton>
                  </div>
                </div>
                <hr />
                <Typography variant="body2" className={classes.commentCount}>
                  52 comments
                </Typography>
                <Button
                  variant="contained"
                  color="success"
                  className={classes.bookNowButton}
                  fullWidth
                >
                  <AccessTimeIcon fontSize="small" className="me-2" />
                  Book now
                </Button>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}
